export const ProductsTable = (props) => {
  const {
    nameOfColumn, //ØªÛŒØªØ±Ù‡Ø§
    dataOfRows,
    placeholder_searchBox,
    go_where, //this icon âž• link to where - hamishe ham link nist
    operation,
    show_addButton,
    show_compo,
    having_searchBox,
  } = props;
  return (
    <div className="p-1 reusable_table">
      <div className="d-flex justify-content-between align-items-center p-2">
        {/* ================== start searchBoxðŸ‘‡ ================== */}
        {having_searchBox ? (
          <div className="input-group mb-3 searchBox">
            <span className="input-group-text searchButton " id="basic-addon2">
              Ø¬Ø³ØªØ¬Ùˆ
            </span>
            <input
              type="text"
              className="form-control searchInput"
              placeholder={placeholder_searchBox}
              onChange={(e) => setSearchChar(e.target.value)}
            />
          </div>
        ) : null}
        <table>
          <thead>
            {nameOfColumn.map((item) => (
              <th>
                <td>{item}</td>
              </th>
            ))}
          </thead>
          <tbody>
            {dataOfRows.map((data) => (
              <tr>
                <td>{data.id}</td>
                <td>{data.title}</td>
                <td>{data.descriptions}</td>
                <td>{data.created_at}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};
